css:
@-moz-document domain("workflowy.com")
{

:root {
	--circle-opacity: rgba(0,0,0,0.0);
        --circle-hover-color: rgba(0,0,0, 0.5);
	--content: "â—¯";
	--font-family: AvenirNext-UltraLight;

    
        --white-donut: url("data:image/svg+xml;charset=UTF-8,<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100' version='1.1'><circle cx='50' cy='50' r='19' stroke='white' stroke-width='5' fill='transparent'/></svg>");
        --gray-donut: url("data:image/svg+xml;charset=UTF-8,<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 100 100' version='1.1'><circle cx='50' cy='50' r='19' stroke='gray' stroke-width='5' fill='transparent'/></svg>");
}
    

.contentTag[title*="Filter #b-" ]:before {
	content: var(--content);
	display: inline !important;
	visibility: visible !important;
	color: var(--circle-opacity) !important;
	font-family: var(--font-family) !important;
}
.contentTag[title*="Filter #b-" ]:hover:before {
	color: var(--circle-hover-color) !important;
}

/* ============================================ */

.b-indian-red-proj > .name > .bullet circle {
    display: none !important;
}

.b-indian-red-proj > .name > .bullet {
    background-image: var(--white-donut) !important;
    background-color: indianred;
    border-radius: 4px !important;
	box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
}

.b-indian-red-proj.open > .name > .bullet, .b-indian-red-proj.task > .name > .bullet {
    background-image: none !important;
    background-color: indianred;
}

[title~="#b-indian-red" ] {
    visibility: hidden !important;
}

span.contentTag[title="Filter #b-indian-red" ] span {
